import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Haul.css";

import hero1 from "../assets/images/hero/hero1.jpg";
import hero2 from "../assets/images/hero/hero2.jpg";
import hero3 from "../assets/images/hero/hero3.jpg";

const heroImages = [hero1, hero2, hero3];

const Haul = () => {
  const [current, setCurrent] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrent((prev) => (prev + 1) % heroImages.length);
    }, 6000);
    return () => clearInterval(interval);
  }, []);

  /* Reveal animation */
  useEffect(() => {
    const items = document.querySelectorAll(".reveal");
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((e) => e.isIntersecting && e.target.classList.add("visible"));
      },
      { threshold: 0.2 }
    );
    items.forEach((i) => observer.observe(i));
    return () => items.forEach((i) => observer.unobserve(i));
  }, []);

  return (
    <div className="haul-page">
      {/* HERO */}
      <section className="haul-hero">
        <div className="haul-hero-image">
          <img src={heroImages[current]} alt="Flatbed Freight" />
        </div>

        <div className="haul-hero-content">
          <h1>Flatbed & Specialized Hauling</h1>
          <p>
            Trusted nationwide freight solutions for oversized, heavy,
            and time-critical shipments.
          </p>

          <div className="hero-buttons">
            <Link to="/HaulWithRGM" className="hero-btn primary">
              Free Rate Quote
            </Link>
            <Link to="/contact" className="hero-btn secondary">
              Contact Us
            </Link>
          </div>
        </div>
      </section>

      {/* INTRO */}
      <section className="haul-intro reveal">
        <blockquote>
          Experts in Flatbed Freight: Industry-Leading Trucking Solutions
          <span>Built on experience, safety, and performance</span>
        </blockquote>

        <p>
          RGM Logistics delivers professional flatbed transportation services
          across the United States, Canada, and Mexico. Our late-model fleet,
          disciplined operations, and experienced drivers ensure reduced delays,
          minimal cargo risk, and consistent on-time delivery.
        </p>
      </section>

      {/* SERVICES */}
      <section className="haul-services reveal">
        <div className="service-card">USA Domestic Freight Services</div>
        <div className="service-card">Canada Freight Services</div>
        <div className="service-card">Mexico Freight Services</div>
        <div className="service-card">Over-Dimensional Flatbed Freight</div>
      </section>

      {/* BENEFITS */}
      <section className="haul-benefits reveal">
        <h2>Why Ship Flatbed Freight with RGM</h2>

        <div className="benefit-grid">
          <div>100% Company-Owned Trucks & Drivers</div>
          <div>Late-Model Flatbed & Step Deck Equipment</div>
          <div>Nationwide Coverage with Flexible Routing</div>
          <div>Safety-Driven Operations & CSA Compliance</div>
          <div>Trailer Pools to Reduce Downtime</div>
          <div>Proven Record of Reliable Delivery</div>
        </div>
      </section>

      {/* CTA */}
      <section className="haul-cta">
        <h2>Move Your Freight with Confidence</h2>
        <p>
          From standard flatbed loads to complex specialized shipments,
          RGM Logistics delivers reliability you can trust.
        </p>

        <div className="cta-buttons">
          <Link to="/HaulWithRGM" className="cta-primary">
            Request a Free Quote
          </Link>
          <Link to="/contact" className="cta-secondary">
            Talk to Our Team
          </Link>
        </div>
      </section>
    </div>
  );
};

export default Haul;
